{/* <button type="button" class="btn btn-outline-info">Info</button> */}
export default class Channels extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            channel: "ant1"
        }
        this.getChannel = this.getChannel.bind(this);
    }

    getChannel = (event) => {
        let newChannel = event.target.textContent;
        console.log(`Channels comp: ${newChannel}`); 
        this.setState({
            channel: newChannel
        })
        console.log(this.state.channel);
        return this.state.channel;
    }

    render() {
        return (
            <div>
                <button type="button" className="btn btn-outline-info" onClick={this.getChannel}>Ant1</button>
                <button type="button" className="btn btn-outline-info"onClick={this.getChannel}>Alpha</button>
                <button type="button" className="btn btn-outline-info">Mega</button>
                <button type="button" className="btn btn-outline-info">Star</button>
                <button type="button" className="btn btn-outline-info">Skai</button>
                <button type="button" className="btn btn-outline-info">Ert1</button>
                <button type="button" className="btn btn-outline-info">Ert2</button>
                <button type="button" className="btn btn-outline-info">Ert3</button>
            </div>
        )
    }
}
